import React from 'react';
import Logo from '../../assets/logo.png'
import Celular from '../../assets/celular.png'
import './Header.css'

const Header = () => {
    return (
        <header className="landingPageWrapper">
            <img src={Logo} className="logo" alt="Logo" />
            <h1 className="titulo">CRIE SEU E-COMMERCE</h1>
            <h2 className="subTitulo1">Chegou a hora de criar seu e-commerce com os especialistas da SmileShop.</h2>
            <h2 className="subTitulo2">Preencha o formulário abaixo que um consultor entrará em contato!</h2>
            <img src={Celular} className="celular" alt="Celular" />
        </header>
    )
}

export default Header;
